angular.module('app').directive('answerButton', function () {
  return {
    restrict: 'E',
    templateUrl: '/directives-templates/answer-button/answer-button.jade',
    scope: {
      'answer': '=?',
      'result': '=?',
      'userAnswer': '=?',
      'answerNumber': '=?',
      'answered': '=?',
      'sendAnswer': '&onClick'
    },
    link: function link(scope, element, attrs) {
      // Animate on click
      var button, circle, d, x, y;
      $('.answer', element).on('click', function (e) {
        if (!scope.answered) {
          button = $(this);
          if (button.find('.circle').length === 0) {
            button.prepend('<span class=\'circle\'></span>');
          }
          circle = button.find('.circle');
          circle.removeClass('animate');
          if (!circle.height() && !circle.width()) {
            d = Math.max(button.outerWidth(), button.outerHeight());
            circle.css({
              height: d,
              width: d
            });
          }
          x = e.pageX - (button.offset().left + parseInt(button.css('padding-left'), 10)) - circle.width() / 2;
          y = e.pageY - (button.offset().top + parseInt(button.css('padding-top'), 10)) - circle.height() / 2;
          circle.css({
            top: y + 'px',
            left: x + 'px'
          }).addClass('animate');
          scope.answered = true;
          scope.userAnswer = scope.answerNumber;
        }
      });
    }
  };
});
function loadingSpinner($http) {
  return {
    restrict: 'E',
    templateUrl: '/directives-templates/loading-spinner/loading-spinner.jade',
    link: function (scope, element) {
      scope.isLoading = function () {
        return $http.pendingRequests.length > 0;
      };
      var timer = 0;
      scope.$watch(scope.isLoading, function (isLoading) {
        if (isLoading) {
          timer = setTimeout(function () {
            element.fadeIn();
          }, 300);
        } else {
          clearTimeout(timer);
          timer = 0;
          element.fadeOut();
        }
      });
    }
  };
}

